    false,nt"url": null,nt"notes": "NODC Accession 0117337 includes Surface
    underway, chemical, meteorological and physical data collected from MONTE OLIVIA
    and Rio Blanco in the English Channel, North Atlantic Ocean, North Sea and South
    Atlantic Ocean from 2009-01-18 to 2009-12-23 and retrieved during cruise 06RB20091213
    and 06ZG20090118. These data include BAROMETRIC PRESSURE, Partial pressure (or fugacity)
    of carbon dioxide - atmosphere, Partial pressure (or fugacity) of carbon dioxide
    - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect these
    data include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator
    for autonomous carbon dioxide (CO2) measurement. These data were collected by Nathalie
    Lefevre of Universite Pierre et Marie Curie; Institut Pierre Simon Laplace; Laboratoire
